		@Test
		void testHorarioSesiones() {
			Cine[] cines= metodos.cuantosCines();
			Cine cine = cines[0];
			Pelicula[] peliculas = metodos.cargarPeliculas(cine);
			Pelicula pelicula= peliculas[0];	
			Calendar cal= Calendar.getInstance();;
			Date fecha = null;
			cal.set(Calendar.DAY_OF_MONTH, 3);
			cal.set(Calendar.MONTH, 2);
			cal.set(Calendar.YEAR, 2023);
			cal.set(Calendar.HOUR, 18);
			cal.set(Calendar.MINUTE, 00);
			
			
			fecha = cal.getTime();
			String[] horas= metodos.horarioSesiones(pelicula, cine, fecha);
			String horasStr="";
			for (int i = 0; i < horas.length; i++) {
				horasStr+= horas[i]+",";
			}
			horasStr="["+ horasStr+"]";
			
			String resul="[16:00,18:00,20:00,]";
			
			assertEquals(resul, horasStr);
			
		
			
		}
		
		@Test
		void testEnQueSalas() {
			Cine[] cines= metodos.cuantosCines();
			Cine cine = cines[0];
			Pelicula[] peliculas = metodos.cargarPeliculas(cine);
			Pelicula pelicula= peliculas[7];	
			Calendar cal= Calendar.getInstance();;
			Date fecha = null;
			cal.set(Calendar.DAY_OF_MONTH, 1);
			cal.set(Calendar.MONTH, 3);
			cal.set(Calendar.YEAR, 2023);
			String hora ="16:00";
			
			fecha = cal.getTime();
			Sala[] salas= metodos.enQueSalas(cine, pelicula, fecha, hora);
			String salasStr="";
			
			for (int i = 0; i < salas.length; i++) {
				salasStr+= salas[i]+",";
			}
			salasStr="["+ salasStr+"]";
			String resul="[16:00,18:00,20:00,]";
			
			assertEquals(resul, salasStr);
			
		
			
		}
